import { Icon } from '@iconify/react'
import wildfire from '@iconify/icons-mdi/fire-alert'

const LocationMarker = ({ type, lat, lng, onClick }) => {
    return (
        <div className="location-marker" onClick={onClick}>
            {type == "volcano" ? <Icon icon="emojione:volcano" className="location-icon" /> : <Icon icon={wildfire} className="location-icon" />}
        </div>
    )
}

export default LocationMarker
